literals:
img {
    max-width: 70px;
    max-height: 70px;
    cursor: pointer;
    margin: auto;
  }

  ul {
    display: flex;
    flex-direction: column;
    list-style: none;

    li {
      display: flex;
      margin: 8px;
      border: 2px silver solid;
      padding: 8px;
      height: 70px;
      width: 70px;
      transition: ease-in-out 0.3s;

      &:hover {
        border: 2px solid #cf5711;
      }
    }
  }
